const t=JSON.parse('{"key":"v-4b35e29c","path":"/Tech/%E7%AC%AC%E4%B8%89%E6%96%B9%E6%8E%88%E6%9D%83%E7%99%BB%E5%BD%95.html","title":"如何为网站接入第三方微信登录教程","lang":"en-US","frontmatter":{"description":"如何为网站接入第三方微信登录教程 Web 网站的用户登录注册方式有用户名密码登录、验证码登录、OAuth 第三方授权登录等。 常用的第三方登录有 QQ、微信、微博、GitHub、知乎等，一般用户常用微信扫码授权的登录方式，今天介绍一下网站接入微信登录的方法。 应用申请 网站应用中接入微信登录是基于OAuth2.0协议标准构建的微信OAuth2.0授权登录系统。 在进行微信OAuth2.0授权登录接入之前，需要在微信开放平台注册开发者帐号，并拥有一个已审核通过的网站应用，并获得相应的AppID和AppSecret，申请微信登录且通过审核后，才能开始接入微信登录流程。","head":[["meta",{"property":"og:url","content":"https://mister-hope.github.io/Tech/%E7%AC%AC%E4%B8%89%E6%96%B9%E6%8E%88%E6%9D%83%E7%99%BB%E5%BD%95.html"}],["meta",{"property":"og:site_name","content":"Blog Demo"}],["meta",{"property":"og:title","content":"如何为网站接入第三方微信登录教程"}],["meta",{"property":"og:description","content":"如何为网站接入第三方微信登录教程 Web 网站的用户登录注册方式有用户名密码登录、验证码登录、OAuth 第三方授权登录等。 常用的第三方登录有 QQ、微信、微博、GitHub、知乎等，一般用户常用微信扫码授权的登录方式，今天介绍一下网站接入微信登录的方法。 应用申请 网站应用中接入微信登录是基于OAuth2.0协议标准构建的微信OAuth2.0授权登录系统。 在进行微信OAuth2.0授权登录接入之前，需要在微信开放平台注册开发者帐号，并拥有一个已审核通过的网站应用，并获得相应的AppID和AppSecret，申请微信登录且通过审核后，才能开始接入微信登录流程。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"en-US"}],["meta",{"property":"article:author","content":"Mr.Jacob"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"如何为网站接入第三方微信登录教程\\",\\"image\\":[\\"\\"],\\"dateModified\\":null,\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"Mr.Jacob\\",\\"url\\":\\"https://mister-hope.com\\"}]}"]]},"headers":[{"level":2,"title":"应用申请","slug":"应用申请","link":"#应用申请","children":[]},{"level":2,"title":"接入微信","slug":"接入微信","link":"#接入微信","children":[{"level":3,"title":"获取授权","slug":"获取授权","link":"#获取授权","children":[]},{"level":3,"title":"获取用户信息","slug":"获取用户信息","link":"#获取用户信息","children":[]}]},{"level":2,"title":"参考","slug":"参考","link":"#参考","children":[]},{"level":2,"title":"更多内容","slug":"更多内容","link":"#更多内容","children":[]}],"git":{"createdTime":null,"updatedTime":null,"contributors":[]},"readingTime":{"minutes":9.37,"words":2811},"filePathRelative":"Tech/第三方授权登录.md","excerpt":"<h1> 如何为网站接入第三方微信登录教程</h1>\\n<p>Web 网站的用户登录注册方式有用户名<strong>密码登录</strong>、<strong>验证码登录</strong>、<strong>OAuth 第三方授权登录</strong>等。</p>\\n<p>常用的第三方登录有 QQ、微信、微博、GitHub、知乎等，一般用户常用微信扫码授权的登录方式，今天介绍一下网站接入微信登录的方法。</p>\\n<h2> <strong>应用申请</strong></h2>\\n<p>网站应用中接入微信登录是基于OAuth2.0协议标准构建的微信OAuth2.0授权登录系统。</p>\\n<p>在进行微信OAuth2.0授权登录接入之前，需要在微信开放平台注册开发者帐号，并拥有一个已审核通过的网站应用，并获得相应的AppID和AppSecret，申请微信登录且通过审核后，才能开始接入微信登录流程。</p>","autoDesc":true}');export{t as data};
